/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `UPDATE_sale_counter` AFTER UPDATE ON `sale_counter`

  FOR EACH ROW

BEGIN

   DECLARE IDC INT;

   DECLARE RunBal DOUBLE;

   DECLARE CSale DOUBLE;

   DECLARE BSale DOUBLE;

   DECLARE IDU DATETIME;

 SET IDC = (SELECT IDCashier FROM `1101-ban_dh`.com_value WHERE IDUser = 1);

 SET IDU = NOW();

IF (NEW.CounterCash <> 0) THEN

   SET RunBal = (SELECT `cashierdate_total_run`.`RunBalance` FROM `cashierdate_total_run`

      INNER JOIN `com_value` ON (`cashierdate_total_run`.`IDDate` = `com_value`.`IDPaid`)

      WHERE  `com_value`.`IDUser` = 1);

    SET CSale = NEW.CounterCash - RunBal;

         INSERT INTO `sale_bulksale`(IDDate,IDCustomer,SAmount,Paid,IDCashier,UpdateID)

         VALUES (OLD.IDDate,1,CSale,CSale,IDC,IDU);

ELSEIF (NEW.CounterCash = 0) THEN

    SET BSale = (SELECT `cashierdate_total_run`.`BulkSale` FROM `cashierdate_total_run`

      INNER JOIN `com_value` ON (`cashierdate_total_run`.`IDDate` = `com_value`.`IDPaid`)

       WHERE  `com_value`.`IDUser` = 1);

         INSERT INTO `sale_bulksale`(IDDate,IDCustomer,SAmount,Paid,IDCashier,UpdateID)

         VALUES (OLD.IDDate,1,-BSale,-BSale,IDC,IDU);

END IF;

END */;;
